import base64
import io

from docx import Document
from ..odoo_utils import fns_datetime

word_file_base64 = ""

word_file_bytes = base64.b64decode(word_file_base64)


def _convert_to_bytes(word_instance: Document) -> bytes:
    new_word_byte_buffer = io.BytesIO()
    word_instance.save(new_word_byte_buffer)
    new_word_byte_buffer.seek(0)
    return new_word_byte_buffer.read()


def build_word_docx(document_record) -> bytes:
    word_instance = Document(io.BytesIO(word_file_bytes))
    # Header
    for section in word_instance.sections:
        header = section.header
        if header.tables:
            table = header.tables[0]
            row = table.rows[0]
            cell = row.cells[2]
            cell.text = cell.text.replace(
                "<PRINT_DATE>",
                fns_datetime.from_naive_utc_to_bolivia_string(document_record.date),
            )
    # Body
    for p in word_instance.paragraphs:
        if "<CITE_TO_REPLACE>" in p.text:
            p.text = p.text.replace("<CITE_TO_REPLACE>", document_record.name)

    return _convert_to_bytes(word_instance)
